import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { AppProvider, useApp } from './context/AppContext';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import './styles/print.css';
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';
import NotificationCenter from './components/common/NotificationCenter';
import HomePage from './pages/HomePage';
import SearchResults from './pages/SearchResults';
import TripDetails from './pages/TripDetails';
import Login from './pages/Login';
import Register from './pages/Register';
import UserDashboard from './pages/UserDashboard';
import ProfilePage from './pages/ProfilePage';
import Booking from './pages/Booking';
import BookingConfirmation from './pages/BookingConfirmation';
import ProtectedRoute from './components/ProtectedRoute';
import AdminDashboard from './pages/admin/AdminDashboard';
import AdminVehicles from './pages/admin/AdminVehicles';
import AdminRoutes from './pages/admin/AdminRoutes';
import AdminSchedule from './pages/admin/AdminSchedule';
import CreateSchedule from './pages/admin/CreateSchedule';
import CustomerServicePortal from './pages/admin/CustomerServicePortal';
import AdminAnalytics from './pages/admin/AdminAnalytics';

// Admin wrapper component to manage admin state
const AdminWrapper = () => {
  const location = useLocation();
  const path = location.pathname.split('/').filter(Boolean);

  // Default to dashboard if just /admin
  if (path.length === 1) {
    return <AdminDashboard />;
  }

  // Route to specific admin pages
  switch (path[1]) {
    case 'dashboard':
      return <AdminDashboard />;
    case 'vehicles':
      return <AdminVehicles />;
    case 'routes':
      return <AdminRoutes />;
    case 'schedule':
      if (path[2] === 'create') {
        return <CreateSchedule />;
      }
      return <AdminSchedule />;
    case 'customer-service':
      return <CustomerServicePortal />;
    case 'analytics':
      return <AdminAnalytics />;
    default:
      return <Navigate to="/admin" replace />;
  }
};

// Regular layout wrapper for non-admin pages
const RegularLayout = ({ children, isHomePage = false }) => {
  return (
    <>
      <Navbar isHomePage={isHomePage} />
      <main className={isHomePage ? '' : 'pt-16 pb-12'}>
        {children}
      </main>
      <Footer />
    </>
  );
};

// Home route wrapper that redirects admin users
const HomeWrapper = () => {
  const { isAuthenticated, isAdmin } = useApp();

  if (isAuthenticated && isAdmin) {
    return <Navigate to="/admin" replace />;
  }

  return <HomePage />;
};

function AppContent() {
  return (
    <AuthProvider>
      <Router>
        <NotificationCenter />

        <Routes>
          {/* Home route with admin redirect */}
          <Route path="/" element={
            <RegularLayout isHomePage={true}>
              <HomeWrapper />
            </RegularLayout>
          } />

          {/* Regular customer pages */}
          <Route path="/search" element={
            <RegularLayout>
              <SearchResults />
            </RegularLayout>
          } />
          <Route path="/trip/:tripId" element={
            <RegularLayout>
              <TripDetails />
            </RegularLayout>
          } />
          <Route path="/login" element={
            <RegularLayout>
              <Login />
            </RegularLayout>
          } />
          <Route path="/register" element={
            <RegularLayout>
              <Register />
            </RegularLayout>
          } />

          {/* Protected customer routes */}
          <Route path="/dashboard" element={
            <RegularLayout>
              <ProtectedRoute>
                <UserDashboard />
              </ProtectedRoute>
            </RegularLayout>
          } />

          <Route path="/booking" element={
            <RegularLayout>
              <ProtectedRoute>
                <Booking />
              </ProtectedRoute>
            </RegularLayout>
          } />

          <Route path="/booking-confirmation" element={
            <RegularLayout>
              <ProtectedRoute>
                <BookingConfirmation />
              </ProtectedRoute>
            </RegularLayout>
          } />

          <Route path="/bookings" element={
            <RegularLayout>
              <ProtectedRoute>
                <UserDashboard />
              </ProtectedRoute>
            </RegularLayout>
          } />

          <Route path="/profile" element={
            <RegularLayout>
              <ProtectedRoute>
                <ProfilePage />
              </ProtectedRoute>
            </RegularLayout>
          } />

          {/* Admin routes with special layout */}
          <Route path="/admin" element={
            <ProtectedRoute requireAdmin>
              <AdminWrapper />
            </ProtectedRoute>
          } />

          <Route path="/admin/*" element={
            <ProtectedRoute requireAdmin>
              <AdminWrapper />
            </ProtectedRoute>
          } />

          {/* 404 Route */}
          <Route path="*" element={
            <RegularLayout>
              <div className="max-w-4xl mx-auto text-center py-16">
                <h1 className="text-4xl font-bold text-gray-900 mb-4">404 - Page Not Found</h1>
                <p className="text-xl text-gray-600 mb-8">The page you're looking for doesn't exist.</p>
                <a href="/" className="btn-primary">
                  Go Back Home
                </a>
              </div>
            </RegularLayout>
          } />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

function App() {
  return (
    <AppProvider>
      <AppContent />
    </AppProvider>
  );
}

export default App;
